import React from 'react';
import './index.css';

export default class Banner extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      pic: [],
      bookList: [],
    };
  }
  toCenter = () => {
    this.props.history.push('/my-center');
  }
  render() {
    return (
      <div className="banner">
        <span className="banner-title">高级编程课程图书借阅系统</span>
        <span className="banner-userName" onClick={this.toCenter}>欢迎，xxx</span>
      </div>
    )
  }
}
